import React from 'react';
import PostCar from "./PostCar/PostCar";
import {addPostCarCreator, updateNewPostTextCarCreator} from "../../redux/car-reducer";
import Car from "./Car";

const CarContainer = (props) => {

    let state = props.store.store.getState();

    let addPost = () => {
        props.store.store.dispatch(addPostCarCreator());
    }

    let onPostChange = (newCar) => {
        let action = updateNewPostTextCarCreator(newCar);
        props.store.store.dispatch(action);
    }

    return (
        <Car
            updateNewPostTextCarCreator={onPostChange}
            addPost={addPost}
            messagesCar={state.profileCar.messagesCar}
            newPostCar={state.profileCar.newPostCar}/> )
};

export default CarContainer;
